import Link from 'next/link';
import { css, jsx } from "@emotion/core";
import styled from "@emotion/styled"

const Container = styled.div`
  display: block;
  
  position: fixed;
  padding: 15px 10px;
  margin: 0px;
  top: 0px;
  left: 0px;
  right: 0px;

  background-color: #BBBBBB;
  border: solid;

  a{
    margin-left: 10px;
    margin-right: 10px;
    text-decoration: none;
  }
`;//margin: 15px;

const MemberWrapper = styled.div`
  display: flex;
  justify-content: flex-end;
  
  margin: 10px;

  font-size: 13px;
  
  border: solid;

  a{
    font: normal normal 18px Noto Sans CJK KR;
    color: #9A9A9A;
  }
`;//float: right;


const Menu = styled.span`
  display: inline;
  float: left;
  
  margin: 10px;

  font-size: 15px;
  a{
    font: normal normal 20px Noto Sans CJK KR;
    color: #707070;
  }
  #logo{
    font: normal bold 28px Noto Sans CJK KR;
    color: #767676;
  }
`;//float: left;  justify-content: flex-start;font-family: 'Noto Sans CJK KR', sans-serif;   font-size: 20px;

const Rank = styled.span`
  display: inline;
  float: right;

  margin: 10px;

  a{
    font: normal normal 20px Noto Sans CJK KR;
    color: #707070;
  }
`;//float: right;justify-content: flex-end; flex-direction: row-reverse;


const Header = () => (
  <Container>
    <MemberWrapper>
      <Link href="/">
      <a className='membership'>로그인</a>
      </Link>
      <a> ｜ </a>
      <Link href="/">
        <a className='membership'>회원가입</a>
      </Link>
    </MemberWrapper>



    <Menu>
      <Link href="/">
        <a className='menu' id='logo'>로고 OR 웹사이트명</a>
      </Link>
  
      <Link href="/">
        <a className='menu'>사이트 소개</a>
      </Link>
      <Link href="/">
        <a className='menu'>나의 사이트</a>
      </Link>
    </Menu>


    <Rank>  
      <a className='rank'>1. 더블슬래시</a>
      <a className='rank' id='button'>ㅁ</a>
    </Rank>
  </Container>
);

export default Header;
